import React from "react";
import "../index.css";

function ImagePopup({ card, onClose }) {
  return (
    <div className="popup popup_type_image-popup">
      <div className="image-popup__content">
        <button className="popup__close-button image-popup__close-button"></button>
        <img className="image-popup__image" alt="" src="/" />
        <h2 className="image-popup__title"></h2>
      </div>
    </div>
  );
}

export default ImagePopup;
